import {BrowserRouter as Router,Route} from 'react-router-dom'
import Home from './Home';
import About from './About';

const App=()=>
{
    return (<>
            <Router>
                
                    <Route path='/' component={Home}></Route>
                    <Route path='/about' component={About}></Route>
                
            
            </Router>
    </>)
}

export default App;
